// Initialize index to track the current row being processed
var index = 0;

// Store CSV data from the incoming message payload
var data = msg.payload;

let timeoutID2 = flow.get("timeoutID2");

// Ensure the data is an array before processing
if (!Array.isArray(data) || data.length === 0) {
    node.error("CSV data is empty or not an array", msg);
    return null;
}

function processNextRow() {
    // Check if all rows have been processed
    if (index >= data.length) {
        node.status({ text: "Test Completed" });
        flow.set("testStep", "Test Completed");
        var triggerMsg = { payload: "Test Completed" };
        node.send([null, triggerMsg]);
        return;
    }

    var row = data[index];

    // Validate row data before processing
    if (!row || row.Duration === undefined) {
        node.error(`Invalid row data at index ${index}: ${JSON.stringify(row)}`, msg);
        return;
    }

    node.status({ text: `Row ${index + 1}: Processing setpoints` });
    flow.set("testStep", "Step" + (index + 1) + " Processing setpoints");

    let modbusValues = [];
    let address = 100; // Starting Modbus address, adjust as needed

    // Process all elements in the row except 'Test Step' and 'Duration'
    Object.keys(row).forEach(tag => {
        if (tag !== "Test_step" && tag !== "Duration") {
            let buffer = Buffer.alloc(4);
            buffer.writeFloatBE(parseFloat(row[tag]), 0);
            modbusValues.push(buffer.readUInt16BE(2)); // High 16 bits
            modbusValues.push(buffer.readUInt16BE(0)); // Low 16 bits
        }
    });

    // Ensure modbusValues length is even (required for Modbus FC16)
    if (modbusValues.length % 2 !== 0) {
        node.error("Invalid register quantity: Must be an even number", msg);
        return;
    }

    // Create Modbus write message with all setpoints
    var combinedMsg = {
        payload: {
            'unitId': 1,
            'fc': 16,  // Function Code: Write Multiple Registers
            'address': address,  // Starting address for the first tag.  Modbus Address (400001 - 400001 = 10 for 0-based addressing)
            'quantity': modbusValues.length,
            'value': modbusValues
        }
    };

    // Retrieve test duration and initialize counter
    var duration = parseInt(row.Duration);
    var counter = 0;

    function loop() {
        let stopTest = flow.get("stopTest");
        let permStatus = flow.get("permStatus");
        let modHoldReg = flow.get("modHoldReg") || [];

        if (stopTest === true || permStatus === false) {
            let statusMessage = "Stopped";
            node.status({ text: statusMessage });
            flow.set("testStep", statusMessage);

            if (timeoutID2) {
                clearTimeout(timeoutID2);
                flow.set("timeoutID2", null); // Clear the timeout ID from flow
            }

            let currentSetpoint = modHoldReg.find(entry => entry["Tag Name"] === "Current_Setpoint");
            let voltageSetpoint = modHoldReg.find(entry => entry["Tag Name"] === "Voltage_Setpoint");

            let resetMsg = {
                payload: {
                    'unitId': 1,
                    'fc': 16,
                    'address': Math.min(currentSetpoint["MODBUS Start Address"], voltageSetpoint["MODBUS Start Address"]) - 400001,
                    'quantity': 4,
                    'value': [0, 0, 0, 0]  // Set both to zero
                }
            };

            var triggerMsg = { payload: "Test Completed" };

            // Send email alert if permStatus is false
            if (permStatus === false) {
                var emailMsg = {
                    topic: "ALERT: Test Stopped Due to permStatus",
                    payload: "The test has been stopped because permStatus is FALSE. Please check the system immediately."
                };
                node.send([resetMsg, triggerMsg, emailMsg]); // Send email as third output
            } else {
                node.send([resetMsg, triggerMsg]);
            }
            return;
        }

        if (counter < duration) {
            node.send([combinedMsg, null]);
            counter++;
            timeoutID2 = setTimeout(loop, 1000); // Check conditions every second
            flow.set("timeoutID2", timeoutID2); // Store the timeout ID in flow
        } else {
            index++;
            processNextRow();
        }
    }


    loop(); // Start the counter loop
}

